import React from 'react';
import './Sidebar.scss';

function Sidebar() {
  return (
    <div className="sidebar">
        <div><img src={require('../images/logo-ia.svg')} alt="logo"></img></div>

        <div className="menu-icon">
            <img src={require('../images/home.svg')} alt="home icon"></img>
            <p className="small-text">Home</p>
        </div>

        <div className="menu-icon">
            <img src={require('../images/artist.svg')} alt="artist icon"></img>
            <p className="small-text">Artist</p>
        </div>

        <div className="menu-icon">
            <img src={require('../images/topic.svg')} alt="topic icon"></img>
            <p className="small-text">Topic</p>
        </div>

        <div className="menu-icon">
            <img src={require('../images/star.svg')} alt="my archive icon"></img>
            <p className="small-text">My Archive</p>
        </div>


    </div>
  );
}

export default Sidebar;
